Debbie Does Dallas Again (1993) [VHSRip]

Debi Diamond, Misty Rain, Steffi, Sunset Thomas, Tammi Ann, Blake Palmer, Steve Drake, Tom Byron, Ron Jeremy

When bookie Ron Jeremy takes a huge bet on Texas to win the super bowl, he decides to take matters into his own hands. He sends his saucy secretary Steffi off to the team's training camp-- along with some of her sexiest, most irresistible gal pals. The idea is to have so much sex with the guys on the team that they are all worn out by game time. Together the gals go all out to seduce every player they can find. It's locker room lust at its most explosive as Debbie does Dallas again -- and again!

